from django.db import modelsclass Subway(models.Model):    stationName = models.CharField(max_length=30)    lat = models.IntegerField()    lng = models.IntegerField()    hosun = models.CharField(max_length=15)    def __str__(self):        return f"stationName={self.stationName}, lat={self.lat}, lng={self.lng}, hosun={self.hosun}"class Cultureplace(models.Model):    group = models.CharField(max_length=10)    placeName = models.CharField(max_length=50)    lineNumber = models.CharField(max_length=15)    station = models.CharField(max_length=15)    address = models.CharField(max_length=50)    lat = models.IntegerField()    lng = models.IntegerField()    def __str__(self):        return f"group={self.group}, placename={self.placeName}, linenumber={self.lineNumber}, station={self.station}, lat={self.lat}, lng={self.lng}"class Place(models.Model):    PlaceNum = models.IntegerField()    Class = models.CharField(max_length=50)    PlaceName = models.CharField(max_length=50)    LineNumber = models.CharField(max_length=50)    Station = models.CharField(max_length=50)    Address = models.CharField(max_length=50)    TelePhone = models.CharField(max_length=50)    Image = models.CharField(max_length=50)    Website = models.CharField(max_length=50)    OpeningHours = models.CharField(max_length=50)    Fee = models.CharField(max_length=50)    Closed = models.CharField(max_length=50)    PayFree = models.CharField(max_length=50)    def __str__(self):        return f"PlaceNum={self.PlaceNum}, Class={self.Class}, PlaceName={self.PlaceName}, LineNumber={self.LineNumber}," \               f"Station={self.Station}, Address={self.Address}, Telephone={self.TelePhone}, Image={self.Image}," \               f"Website={self.Website}, OpeningHours{self.OpeningHours}, Fee={self.Fee}, Closed={self.Closed}, PayFree={self.PayFree}"class Program(models.Model):    ProgramNumber = models.IntegerField()    Category = models.CharField(max_length=50)    ProgramName = models.CharField(max_length=50)    PlaceName = models.CharField(max_length=50)    Image = models.CharField(max_length=50)    StartDay = models.DateField()    EndDay = models.DateField()    TargetAudience = models.CharField(max_length=50)    Fee = models.CharField(max_length=50)    def __str__(self):        return f"ProgramNumber={self.ProgramNumber}, Category={self.Category}, ProgramName={self.ProgramName}," \               f"PlaceName={self.PlaceName}, Image={self.Image}, StartDay={self.StartDay}, EndDay={self.EndDay}," \               f"TargetAudience={self.TargetAudience}, Fee={self.Fee}"